import React from "react";
import "./Caroussel.css";

export default function Caroussel(props) {

const images = props.pictures;
console.log(images);

    return (
        <div id="caroussel">
            {images.map((image) =>
                <img className="image__caroussel active"
                    src={image}
                    key={image}
                    alt={image}
                />
            )}
        </div>
    )
}
